import React from 'react';
import '../styles/ServiceCard.css';

const ServiceCard = ({ name, description }) => (
  <div className="service-card">
    <img src="/static/assets/images/service-icon.png" alt={name} />
    <h2>{name}</h2>
    <p>{description}</p>
  </div>
);

export default ServiceCard;
